import React from "react";
import Button from "@mui/material/Button";
import Stack from "@mui/material/Stack";
import TextField from "@mui/material/TextField";
import Typography from "@mui/material/Typography";
import { useTheme } from "@mui/material/styles";
import { useNavigate } from "react-router-dom";

const ResetPasswordEmailPage = () => {
  const theme = useTheme();
  const primaryColor = theme.palette.primary.main;
  const gray1 = theme.palette.gray1.main;
  const gray2 = theme.palette.gray2.main;
  const navigate = useNavigate();

  const buttonStyle = {
    width: "140px",
    borderRadius: "8px",
    color: primaryColor,
    textTransform: "none",
  };

  return (
    <Stack
      spacing={5}
      sx={{
        width: "616px",
        margin: "0 auto",
        marginTop: "96px",
        textAlign: "left",
      }}
    >
      <Stack spacing="60px">
        <Stack spacing={2}>
          <Typography variant="h5" component="h1" sx={{ color: gray1 }}>
            Reset Password
          </Typography>
          <Typography paragraph={true} sx={{ color: gray2 }}>
            Send OTP code to your email address
          </Typography>
        </Stack>
        <TextField type="email" label="Email" />
      </Stack>
      <Stack direction="row" spacing={3} sx={{ alignSelf: "flex-end" }}>
        <Button variant="outlined" color="primary" sx={buttonStyle}
        onClick={() => navigate('/login')}>
          Cancel
        </Button>
        <Button variant="contained" color="secondary" sx={buttonStyle} 
        onClick={() => navigate('/resetpassword')}>
          Confirm
        </Button>
      </Stack>
    </Stack>
  );
};

export default ResetPasswordEmailPage;
